window.bookSummaryJSON = "<p><b>Narrated by Academy Award winner Kate Winslet comes the sequel to Michael Buckleyâ€™s tragically hilarious family listen </b><b><i>The Weirdies</i></b><b>.</b></p> <p>The Weirdie Triplets and Miss Emily are settling into Deadeye Manor when, against all logic, their parents return from the dead! Even worse, they want Barnacle, Melancholy and Garlic back, sparking a truly unusual effort to prove that Miss Emily is the best parent for them.</p> <p>Will the family get justice? Will the triplets succeed in their ridiculous fundraisers to pay for the lawyer? Why are there so many raccoons in the courtroom? The only way to find out is to listen to the tragic, troubling, absurd tale of how the Weirdies get weirder.</p>"; 
